    cin >> warzywa[i].jakosc;
    cout << "\nPodaj mase: ";
    cin >> warzywa[i].masa;
};

cout << "\nPodaj nazwe pliku: ";
cin >> nazwa;
cout << "\nPodaj rozmiar tablicy warzyw: ";
zapis(warzywa, rozmiar, nazwa);
system("pause");
}

